import './FaceRecognition.css';

const FaceRecognition = ({ imageUrl, data }) => {
  return (
    <div className='center ma flex'>
      <div className='mt2 mr2'>
        <img id='inputimage' alt='' src={imageUrl} width='500px' heigh='auto'/>
        {/* <div className='bounding-box' style={{top: box.topRow, right: box.rightCol, bottom: box.bottomRow, left: box.leftCol}}></div> */}
      </div>
      <div className='mt2 mr2 ba bw2 w4 pa3' id='display'>{data.map((element) => <ul><li>{element}</li></ul>)}</div>
      {/* {data.forEach(element => <div className='mt2 mr2 ba bw2 w4 pa3'>{element}</div>)} */}
      {/* {document.getElementById('display').innerHTML = data.forEach(element => {element}) */}
    </div>
  );
}

export default FaceRecognition;
